import React from 'react';
import { Container, Navbar, Nav } from 'react-bootstrap';

const BiteHeader = () => {
  return (
    <Container fluid className="px-4 bg-light">
      <Navbar expand="lg" className="py-1 d-flex justify-content-between">
        <Navbar.Brand href="#home" className="fs-3 fw-bold"></Navbar.Brand>
        <Nav.Link href="#shop" className="fs-6">Shop All Products</Nav.Link>
      </Navbar>
    </Container>
  );
};

export default BiteHeader;
